import React from "react";
import ReactDOM from "react-dom";

function Card(props) {
    console.log(props);
  return (
    <>
      <div className="cards">
        <div className="card">
          <img src="" alt="show-img" className="card-img" />
          <div className="card-info">
            <span className="category">{props.title}</span>
            <h3 className="card-title">{props.Sname}</h3>
            <a href={props.link} target="_blank" rel="noreferrer">
              <button>Watch Now</button>
            </a>
          </div>
        </div>
      </div>
    </>
  );
}

ReactDOM.render(
  <>
    <Card imgsrc="https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/e3f735a5-b23a-4ec9-8773-ad4579b4d65c/dbz9mxv-c1bc1575-3b9d-454f-8a3e-c75898fba255.png?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..C-GXMP-z9j3Of1flh6gL8L1ioRl1U6347VapgGR0t3c" title="A Netflix opriginal series" Sname="DARK" link="https://www.netflix.com/in/title/80100172"/> 
    <Card />
  </>,
  document.getElementById("root")
)
